import styled from "styled-components";
import backGroundImg from "./images/bgGame.png";

function App() {
  return (
    <Wrapper>
      <div>
        <h1 className="text-center">GAME KÉO BÚA BAO</h1>
      </div>
    </Wrapper>
  );
}
export default App;

const Wrapper = styled.div`
  background: url(${backGroundImg});
  width: 100vw;
  height: 100vh;
  h1 {
    color: white;
  }
`;
